import React from 'react';
import { NavLink } from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';
import Harry from './HappyHarry.png';

function NavBar() {
    return (
        <div style={{ backgroundColor: 'red' }}>
            <Nav className="justify-content-end mainNav" activeKey="/" style={{ backgroundColor: '#5b9bd5' }}>
                <img src={Harry} alt="Logo" style={{ height: '40px', marginRight: '10px' }} />
                <div className="d-flex align-items-center">
                    <h3 className="text-light">Happy Harry's Hardware</h3>
                </div>
                <Nav.Item style={{ backgroundColor: '#F8CBAD', marginRight: '10px' }}>
                    <Nav.Link as={NavLink} to='/'>Home</Nav.Link>
                </Nav.Item>
                <Nav.Item style={{ backgroundColor: '#F8CBAD', marginRight: '10px' }}>
                    <Nav.Link as={NavLink} to='/customers'>Customers</Nav.Link>
                </Nav.Item>
                <Nav.Item style={{ backgroundColor: '#F8CBAD', marginRight: '10px' }}>
                    <Nav.Link as={NavLink} to='/products'>Products</Nav.Link>
                </Nav.Item>
                <Nav.Item style={{ backgroundColor: '#F8CBAD', marginRight: '10px' }}>
                    <Nav.Link as={NavLink} to='/sales'>Sales</Nav.Link>
                </Nav.Item>
            </Nav>
        </div>
    );
}

export default NavBar;
